pgn_string = older_pgn

import chess.pgn
import io

pgn = io.StringIO(pgn_string)

# File reading option
# pgn = open("pgn_sample.txt")
game = chess.pgn.read_game(pgn)
board = game.board()
fen_list = []

for node in game.mainline():
    move = node.move
    eval = node.eval()
    if eval:
       score = eval.white().score()
       if score:
           score = score/100.0

    board.push(move)
    fen_list.append((board.fen(), score))
    
for position in fen_list:
  print(position)